import React from 'react';

const TestPage = () => {
  return (
    <div style={{ padding: '20px', backgroundColor: 'lightblue', minHeight: '100vh' }}>
      <h1>Test Page - Site is Working</h1>
      <p>If you see this, React is rendering properly.</p>
    </div>
  );
};

export default TestPage;
